import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { fetchProfile } from '../services/api'; // Adjust the import path as needed

const Profile = () => {
  const [profile, setProfile] = useState(null);
  const [error, setError] = useState('');

  useEffect(() => {
    const getProfile = async () => {
      try {
        const token = localStorage.getItem('authToken'); // Ensure token key is consistent
        if (!token) {
          setError('No token found. Please log in.');
          return;
        }

        console.log('Attempting to fetch profile with token:', token);

        const data = await fetchProfile();
        setProfile(data);
      } catch (error) {
        setError('Failed to load profile.');
        console.error('Error fetching profile:', error.response ? error.response.data : error.message);
      }
    };

    getProfile();
  }, []);

  if (error) return <p style={{ color: 'red' }}>{error}</p>;

  return (
    <div>
      <h2>Profile</h2>
      {profile ? (
        <div>
          <p>Name: {profile.name}</p>
          <p>Mobile: {profile.mobile}</p>
          <p>Email: {profile.email}</p>
          <p>Date of Birth: {profile.dob}</p>
          <p>Gender: {profile.gender}</p>
          <p>Address: {profile.address}</p>
        </div>
      ) : (
        <p>Loading profile...</p>
      )}
      <p>Welcome to your profile page!</p>
      <Link to="/api/profile-update" className="btn">Update Profile</Link>
    </div>
  );
};

export default Profile;
